import React, { useState } from "react";
import Form from "./components/Form";

function App() {
  return (
    <div>
      <header></header>

      <main>
        <article>
          <h1>Search Engine</h1>
          <Form />
        </article>
      </main>
    </div>
  );
}

export default App;
